import { useState } from 'react'


export const  usePokemons = async () => {
    const [data, setData] = useState();

    try {
        const response = await fetch("https://pokeapi.co/api/v2/pokemon/?offset=20&limit=20");
        const data = await response.json();
        console.log(data);
        setData(data);
    } catch (error) {
        console.log(error);
    } 

    return data
};
